import fire from '../fire'

const Hero = () => {

    const handleLogout = () => {
        fire.auth().signOut();
        //setUser('');
      };

    return (
        <section className="hero">
            <nav>
                <h2>Welcome</h2>
                <button onClick={handleLogout}>Sign out</button>
            </nav>
        </section>
    )
}

export default Hero;
